import Header from "../components/Header";
import PaketAdd from "../components/addOn";
import Footer from "../components/Footer";
import Snk from "../components/Snk";

const PaketAddOn = () => {
    return (
        <>
        <Header />
        <PaketAdd />
        <Snk />
        <Footer />
        </>
    )
}

export default PaketAddOn
